def correct_bracketing(brackets: str):
    """ brackets is a string of "(" and ")".
    return True if every opening bracket has a corresponding closing bracket.

    >>> correct_bracketing("(")
    False
    >>> correct_bracketing("()")
    True
    >>> correct_bracketing("(()())")
    True
    >>> correct_bracketing(")(()")
    False
    """

    if (len(brackets) % 2) == 1:
        return False

    brace_list = ["("]
    for bracket in brackets:
        if bracket == "(":
            brace_list.append("(")
        elif bracket == ")":
            if "(" in brace_list:
                brace_list.pop()
            else:
                brace_list.append(")")

    if brace_list:
        return False
    else:
        return True


