                shortest_path = path + [end]
                break
            self._visited.add(path[-1])
            nodes = set(self.neighbors(path[-1])) - self._visited
            if self._g_directed:
                nodes = {node for node in nodes if node in self._map[end]}
            if not nodes:
                continue
            stack.append(path + [nodes.pop()])
            no_duplicates = True
            while nodes:
                node = nodes.pop()
                if node not in self._visited:
                    if no_duplicates:
                        no_duplicates = False
                        stack.append(path + [node])
                    else:
                        self._visited.add(node)
        return shortest_path

    def add_node(self, node):
        """
        Add a node to the graph.
        /!\ Do not add the same node twice.
        :param node: str
        :return: none
        """
        if node not in self._map:
            self._map[node] = set()

    def remove_node(self, node):
        """
        Remove a node from the graph along with all its neighbors.
        /!\ Do nothing if the node does not exist.
        :param node: str
        :return: none
        """
        if node in self._map:
            for n in self._map[node]:
                if node in self._map[n]:
                    self._map[n].remove(node)
            del self._map[node]

    def add_edge(self, u, v):
        """
        Add a unidirectional edge between 'u' and 'v'.
        /!\ Do not add the same edge twice.
        :param u: str
        :param v: str
        :return: none
        """
        if u in self._map:
            self._map[u].add(v)
        else:
            self._map[u] = {v}

    def remove_edge(self, u, v):
        """
        Remove the edge between 'u' and 'v'.
        /!\ Do nothing if the there is no edge to remove.
        :param u: str
        :param v: str
        :return: none
        """
        if u in self._map and v in self._map[u]:
            self._map[u].remove(v)


class Bag(list):
    def __init__(self, data=[], size=0):
        """
        Create bag out of list of data and expected number of elements
        :param data: list
        :param size: int
        """
        self.data = data
        self._size = size if size else len(data)

    @property
    def capacity(self):
        return self._size

    def contains(self, item):
        return item in self.data

    def is_empty(self):
        return not self.data

    def size(self):
        return len(self.data)

    def resize(self, new_capacity):
        for i in range(new_capacity):
            self.data.append(0)

    def __add__(self, other):
        return [x + y for x, y in zip(self.data, other.data)]

    def __iadd__(self, other):
        self.data = [x + y for x, y in zip(self.data, other.data)]
        return self

    def __sub__(self, other):
        return [x - y for x, y in zip(self.data, other.data)]

    def __isub__(self, other):
        self.data = [x - y for x, y in zip(self.data, other.data)]
        return self

    def __mul__(self, other):
        return [x * y for x, y in zip(self.data, other.data)]

    def __imul__(self, other):
        self.data = [x * y for x, y in zip(self.data, other.data)]
        return self

    def __truediv__(self, other):
        results = []
        for x, y in zip(self.data, other.data):
            if y is 0:
                results.append(0)
                continue
            results.append(x / y)
        return results

    def __itruediv__(self, other):
        results = []
        for x, y in zip(self.data, other.data):
            if y is 0:
                results.append(0)
                continue
            results.append(x / y)
        self.data = results
        return self

    def __pow__(self, power):
        return  [x ** power for x in self.data]
